import React, { Component } from 'react'
import { Card, CardBody, CardFooter, CardHeader, Row, Col} from 'reactstrap';

export class Item extends Component {
  constructor(props){
    super(props)
    this.state={
      data:this.props.data
    }
  }
    render() {
        return (
            <>
             <Card>
              <CardHeader>
                {this.state.data.name}
              </CardHeader>
              <CardBody>  {this.state.data.description}</CardBody>
              <CardFooter>
                <Row>
                  <Col xs="6">
                Price: {this.state.data.price} EGP
                </Col>
                </Row>
                </CardFooter>
            </Card>   
            </>
        )
    }
}

export default Item
